#A
# A shows how much a sector buys from another to create one euro of rev (value purchased / value rev)
doc = codecs.open('A.txt','rU')
A = pd.read_csv(doc, sep='\t')
A.rename(columns=A.iloc[0,:],inplace=True)
del A['sector']
A.drop(A.index[0])
A = A.iloc[2:,0:]
A = A.reset_index(drop=True)
A.iloc[:,1:] = A.iloc[:,1:].astype(float)
sumA = A.iloc[:,1:].sum().reset_index()
sumA = sumA.T

# F (Added value)
doc = codecs.open('F.txt', 'rU')
F = pd.read_csv(doc, sep='\t')
F.rename(columns=F.iloc[0, :], inplace=True)
# extracting added value (AV) from table F
AV = F.iloc[1:10, :]
del AV['sector']
AV.iloc[0:, 0:] = AV.iloc[0:, 0:].astype(float)
AV = AV.sum().reset_index()  # results in a 7987 rows df (49 countries x 163 industries)
AV = AV.T

#revenue matrix
sumA1=sumA
sumA1 = sumA1.replace(0.0, np.NaN)
sumA1 =sumA1.drop(sumA1.index[0])
rev_matrix = pd.DataFrame(np.nan, index=range(0,1), columns=range(0,7987))
for j in range(0,7987):
        rev_matrix.iloc[0, j] = AV.iloc[1, j] / (1-sumA1.iloc[0, j])

#code for distance calculations
from geopy.distance import vincenty
distance = pd.read_csv('org_country_capitals.csv', error_bad_lines=False, delimiter=',')
distance1=distance
distance1=distance1.drop(['CountryName','CapitalName','CountryCode','ContinentName'], axis=1)
distance2 = distance1.assign(coords = distance1.CapitalLatitude.astype(str) + ', ' + distance1.CapitalLongitude.astype(str))
square = pd.DataFrame(
   np.zeros(len(distance2) ** 2).reshape(len(distance2), len(distance2)),
   index=distance2.index, columns=distance2.index)
def get_distance(col):
   end = distance2.ix[col.name]['coords']
   return distance2['coords'].apply(vincenty, args=(end,), ellipsoid='WGS-84')
distances = square.apply(get_distance, axis=1).T
def units(input_instance):
   return input_instance.km
distances_km = distances.applymap(units)

